descriptions:
{'es-ES': 'PROMOCION HUERTA TELLEZ  de renta libre en Ceuta formada  de pisos de 2,3 y 4 dormitorios, con plaza de garaje y trastero incluido. Esta nueva promocion de viviendas que comercializa ikesa Real Estate se localiza en la zona llamada cuesta parisiana, en la avenida Miguel Arruda, zona llena de vida rodeada de colegios e intitutos, supermecados, instalaciones deportivas y cerca del Hospital Universitario de Ceuta.
La promocion esta orientada al sur con unas fantasticas vistas panoramicas de la costa y bahia de Ceuta que nos une con marruecos mucha luz natural que invade cada rincon. CONSULTANOS Y RESERVA YA TU PISO NUEVO en Ceuta.		
					
					
'}

{'es-ES': 'Se vende vivienda reformada en Barriada José Zurrón.   

5° piso sin ascensor. La vivienda consta de 2 habitaciones, amplio salón, cocina, lavadero y trastero.

Dormitorio principal con amplio armario empotrado, suelos de madera, aire acondicionado en salón, dos armarios empotrados más en pasillo y baño.'}

